  [],\n\t\"revision_timestamp\": \"2016-10-15T16:36:08.502725\",\n\t\"name\": \"iroquois-national-wildlife-refuge-annual-narrative-report-calendar-year-1981\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Iroquois
  NWR outlines Refuge accomplishments during the 1981 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses research and
  investigations. Refuge administration is outlined; information about personnel,
  youth programs, funding, and safety is given. Habitat management is also covered;
  subjects include wetlands, forests, croplands, grazing, haying, and fire management.
  The wildlife section of the report discusses endangered and threatened species,
  waterfowl, marsh birds and waterbirds, raptors, game mammals, and marking and bird
  banding. The public uses of the Refuge described in this report include outdoor
  classrooms, interpretive programs, hunting, fishing, trapping, wildlife observation,
  outdoor recreation, and law enforcement. The equipment and facilities section of
  the report provides information about major maintenance, equipment replacement,
  communication systems, and energy conservation. Items of interest are provided at
  the end. Refuge brochures are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
